import React from "react";
import "./App.css";
import Home from "./pages/Home/Home";
import Chatbot from "./pages/Chatbot/Chatbot";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";

function App() {
  return (
    <div>
      <Router>
        <Switch>
          <Route path="/chatbot">
            <Chatbot />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </Router>
    </div>

  );
}

export default App;
